import Navbar from "../components/Navbar";
import styled from "styled-components";

const Home = () => {
    return (
        <Container>
            <Navbar/>
        </Container>
    )
}

const Container = styled.div`
    display: flex;
    flex-direction: column;
    width: 100vw;
    height: 100vh;
`;

export default Home;
